ou can cancel your contract at any time up to 14 days after the day of delivery. To do this, please e-mail, or write to us. We are unable to accept cancellations by phone.</p>\r\n\r\n<p>You do not have to give any reason for cancellation. However, a brief explanation will help us to improve the service we offer to customers in the future.&nbsp;If you cancel, you must return the goods within 14 days of cancellation, complete with the original packaging to us and/or our supplier (or any other UK address specified by us), at your own expense. You must ensure that the goods are packaged adequately to protect against damage.</p>\r\n\r\n<p>You may properly examine the goods for 14 days, however you may not return any goods that have been installed unless they are faulty.</p>\r\n\r\n<p>If you fail to return the goods, we will collect them, and we will charge you the direct cost of collection. If you fail to take reasonable care of the goods before they are returned to us, and this results in damage or deterioration, we will charge you for the reduction in value.</p>\r\n\r\n<p>We will refund all monies paid to us by you including any postage / carriage within 30 days, less any costs due under this contract. Please see point 5.1 for exemptions.</p>\r\n\r\n<p>We reserve the right not to replace any item that has been fitted, as we will deem this acceptance of the goods.</p>\r\n\r\n<p>We will not be held liable for fitter&rsquo;s fees or any other professional trades person&rsquo;s fees due to late, damaged or lost deliveries.</p>\r\n\r\n<p>We are not liable for any loss earnings due to late, incorrect or lost deliveries.</p>\r\n\r\n<p>We reserve the right to refuse replacements on any damaged items reported to us outside of two working days.<br />\r\n<br />\r\nThis cancellation policy does not affect your legal rights - for example, if goods are faulty or Misdescribed.</p>\r\n\r\n<p>&nbsp;<strong>Guarantee, Faulty goods</strong></p>\r\n\r\n<p><br />\r\nIf there is a problem with the goods, please notify us by email or in writing providing details of the problem. In addition, you must provide us with a digital photograph of the problem as this saves you having to return the goods for inspection. We will deal with the matter in accordance with your legal rights.</p>\r\n\r\n<p>All goods are covered by a manufacturer&rsquo;s warranty against faulty workmanship and materials, subject to the terms and conditions of that warranty.</p>\r\n\r\n<p>The manufacturer&rsquo;s warranty is provided in addition to the rights that the law says you have as a consumer and accordingly, your statutory rights are not affected.</p>\r\n\r\n<p>If an exchange is necessary, this will be arranged without unreasonable delay and without charge. Replacement goods will not be dispatched until either an indicative digital image is supplied by the customer, or the original goods have been received at our warehouse and checked.&nbsp;<br />\r\n<br />\r\nThe cost of returning goods to us is your responsibility, however on inspection we will refund your reasonable postage costs, providing that the goods are found to be faulty. If the goods are not faulty, we will return them to you, however you will be required to cover our reasonable postage costs.</p>\r\n\r\n<p>Doors, drawers and colour matched accessories from our&nbsp; ranges are guaranteed against materials and workmanship defects for a period of 1 years as of 1st March Prior to this, date they are guaranteed for 4 years. Doors, drawers and colour matched accessories from our Bella and Zurfiz ranges are guaranteed against materials and workmanship defects for a period of 3 years.</p>\r\n\r\n<p>Doors should be cleaned in accordance with our care and maintenance instructions, failure to do so may void your warranty.</p>\r\n\r\n<p>Items situated below a sink, covering a dishwasher, washing machine or other similar appliance should be protected against excessive water contact.</p>\r\n\r\n<p>Items located near any source of heat or steam should be protected either by heat deflectors or other suitable protection.</p>\r\n\r\n<p>Within the time-scale laid out in point 6.5, we will replace defective goods free of charge, at our discretion, providing that you have returned to us any faulty goods upon request.</p>\r\n\r\n<p>Other items such as hinges, handles and drawers are guaranteed for 1 year from the date of delivery. Within this time-scale, we will replace defective goods, as outlined above, free of charge.</p>\r\n\r\n<p>If an item is no longer available, we will offer an alternative. However, our liability will be to replace the faulty goods only and we are unable to guarantee an exact match. In this instance, you will have the option of a refund on the items under the warranty claim.</p>\r\n\r\n<p>Where we replace faulty goods you are responsible for their disposal if they have not previously been returned to us.</p>\r\n\r\n<p>We are unable to guarantee and exact colour match due to the nature of the product.</p>\r\n\r\n<p>All products are manufactured to tolerances of +/- 1.5mm.</p>\r\n\r\n<p>The manufacturing process and materials used in the production of frame (glazed) doors means that we are unable to guarantee that the vinyl will always be pushed tightly into the internal corner of the frame. This is not a manufacturing fault, and can only be seen from the back of the door. This does not affect the performance or guarantee of the product.</p>\r\n\r\n<p>&nbsp;<strong>Our liability</strong></p>\r\n\r\n<p>We will not be liable to you for any loss of revenue, profits, anticipated savings, goodwill or business opportunity, for any injury to your reputation or for any losses that are not reasonably foreseeable by both of us at the time your purchase is made or your order is accepted.</p>\r\n\r\n<p><strong>Events Beyond Our Reasonable Control</strong><br />\r\nWe will not be responsible for any delay or failure to comply with these general terms and conditions or the returns policy if the delay or failure arises from any event which is beyond our reasonable control. Such events would include (but are not limited to) fires, floods, earthquakes, storms, natural disasters, war, civil unrest, acts of terrorism or malicious damage to or destruction of our premises, equipment or goods.&nbsp;<br />\r\n<br />\r\n<strong>Invalidity</strong><br />\r\nIn the event that one or more of the terms set out in these general terms and conditions or in the returns policy is held to be invalid by a competent authority, the remaining terms shall continue to have effect and you will still be bound by them.</p>\r\n\r\n<p><strong>Privacy</strong><br />\r\nPersonal information, such as your contact details, that you provide to us during the order process will be kept and used by us in accordance with our&nbsp;&nbsp;Privacy policy</p>\r\n\r\n<p><br />\r\n<strong>Governing Law</strong><br />\r\nThis agreement is governed by English law unless you live in Scotland in which case it will be governed by Scots law. Each of us agrees to bring legal actions relating to these general terms and conditions and the returns policy.</p>\r\n\r\n<p>&nbsp;</p>','2018-08-26 10:16:18','2018-09-19 15:03:02',NULL),(2,'Care and Maintenance','<p><strong>Door Care</strong></p>\r\n\r\n<p><strong>Care and Maintenance</strong><br />\r\nAs with all timber based items our products should not be stored or installed in a newly plastered or damp<br />\r\nenvironment. To clean door surfaces use a soft clean cloth, warm soapy water should be used to dampen the<br />\r\ncloth (not wet).<br />\r\nDry off with a soft dry cloth. Do not use aggressive cleaning liquids or items such as Brillo Pads etc.<br />\r\nTo avoid damage by excessive heat please follow these simple guidelines:<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;*When installing doors adjacent to ovens always ensure that doors are shielded by using heat deflector strips<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;*Never use any appliance which generates high levels of heat or concentrated steam (such as a toaster,<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;kettle or pressure cooker) directly under or adjacent to a door or panel.</p>\r\n\r\n<p><strong>High Gloss Colours</strong><br />\r\nAfter removing the protective film please allow the surface to cure for seven days before cleaning or wiping.<br />\r\nTo clean the surface of the doors, wipe using a soft cloth with a mild, non abrasive, dishwashing detergent<br />\r\ndiluted in warm water. The mix should be 1% detergent to 99% warm water. You should never use any<br />\r\nvinegar based detergents, solvents, abrasive detergents, white spirit or furniture polish.</p>\r\n\r\n<p><br />\r\nPolishing High Gloss finishes will leave minor scratches and polish marks, this is normal with this type of finish.</p>\r\n\r\n<p><strong>Door Care Kit</strong><br />\r\nKit includes a 235ml aerosol of VuPlex polish, micro anti scratch polishing cloth and full instructions.<br />\r\nThe door care kit is suitable for use with all door finishes and is especially effective on<br />\r\nhigh gloss finishes.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; *VuPlex special formula cleans using safe ingredients that won&rsquo;t damage the surface.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; *The anti static properties limit the amount of dust particles<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;attracted to the surface that can lead to scratching.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; *Accelerates the hardening process on high gloss<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; finishes after film removal which increases protection instantly. Apply directly after removal of film.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; *Leaves a coating of polymer that acts as an invisible barrier stopping small scratches &amp; sun light fade.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; *Polishes the surface leaving a high lustre streak free finish.</p>','care-and-maintenance','<p><strong>Door Care</strong></p>\r\n\r\n<p><strong>Care and Maintenance</strong><br />\r\nAs with all timber based items our products should not be stored or installed in a newly plastered or damp<br />\r\nenvironment. To clean door surfaces use a soft clean cloth, warm soapy water should be used to dampen the<br />\r\ncloth (not wet).<br />\r\nDry off with a soft dry cloth. Do not use aggressive cleaning liquids or items such as Brillo Pads etc.<br />\r\nTo avoid damage by excessive heat please follow these simple guidelines:<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;*When installing doors adjacent to ovens always ensure that doors are shielded by using heat deflector strips<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;*Never use any appliance which generates high levels of heat or concentrated steam (such as a toaster,<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;kettle or pressure cooker) directly under or adjacent to a door or panel.</p>\r\n\r\n<p><strong>High Gloss Colours</strong><br />\r\nAfter removing the protective film please allow the surface to cure for seven days before cleaning or wiping.<br />\r\nTo clean the surface of the doors, wipe using a soft cloth with a mild, non abrasive, dishwashing detergent<br />\r\ndiluted in warm water. The mix should be 1% detergent to 99% warm water. You should never use any<br />\r\nvinegar based detergents, solvents, abrasive detergents, white spirit or furniture polish.</p>\r\n\r\n<p><br />\r\nPolishing High Gloss finishes will leave minor scratches and polish marks, this is normal with this type of finish.</p>\r\n\r\n<p><strong>Door Care Kit</strong><br />\r\nKit includes a 235ml aerosol of VuPlex polish, micro anti scratch polishing cloth and full instructions.<br />\r\nThe door care kit is suitable for use with all door finishes and is especially effective on<br />\r\nhigh gloss finishes.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; *VuPlex special formula cleans using safe ingredients that won&rsquo;t damage the surface.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; *The anti static properties limit the amount of dust particles<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;attracted to the surface that can lead to scratching.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; *Accelerates the hardening process on high gloss<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; finishes after film removal which increases protection instantly. Apply directly after removal of film.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; *Leaves a coating of polymer that acts as an invisible barrier stopping small scratches &amp; sun light fade.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; *Polishes the surface leaving a high lustre streak free finish.</p>','2018-09-03 07:04:42','2018-09-19 15:00:41',NULL),(3,'Return and Cancellation','<p>This policy does not apply to&nbsp;goods ordered by businesses which are exempt from the Consumer Contract Regulations from 13 June 2014, or the following goods which are exempt from the right to cancel.&nbsp;<br />\r\nYou do not have the right to cancel items which have been modified from standard at your request. This includes but is not limited to hinge holes and custom sizes.</p>\r\n\r\n<p>Any items which have been custom made, such as doors made from our Made to Order ranges, colours/styles outside of the options listed on our website.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p>You can cancel your contract at any time up to 14 days after the day of delivery. To do this, please e-mail, or write to us. We are unable to accept cancellations by phone.</p>\r\n\r\n<p>You do not have to give any reason for cancellation. However, a brief explanation will help us to improve the service we offer to customers in the future.&nbsp;If you cancel, you must return the goods within 14 days of cancellation, complete with the original packaging to us and/or our supplier (or any other UK address specified by us), at your own expense. You must ensure that the goods are packaged adequately to protect against damage.</p>\r\n\r\n<p>You may properly examine the goods for 14 days, however you may not return any goods that have been installed unless they are faulty.</p>\r\n\r\n<p>If you fail to return the goods, we will collect them, and we will charge you the direct cost of collection. If you fail to take reasonable care of the goods before they are returned to us, and this results in damage or deterioration, we will charge you for the reduction in value.</p>\r\n\r\n<p>We will refund all monies paid to us by you including any postage / carriage within 30 days, less any costs due under this contract. Please see point 5.1 for exemptions.</p>\r\n\r\n<p>We reserve the right not to replace any item that has been fitted, as we will deem this acceptance of the goods.</p>\r\n\r\n<p>We will not be held liable for fitter&rsquo;s fees or any other professional trades person&rsquo;s fees due to late, damaged or lost deliveries.</p>\r\n\r\n<p>We are not liable for any loss earnings due to late, incorrect or lost deliveries.</p>\r\n\r\n<p>We reserve the right to refuse replacements on any damaged items reported to us outside of two working days.<br />\r\n<br />\r\nThis cancellation policy does not affect your legal rights - for example, if goods are faulty or Misdescribed.</p>','return-and-cancellation','<p><strong>This policy does not apply to</strong>&nbsp;goods ordered by businesses which are exempt from the Consumer Contract Regulations from 13 June 2014, or the following goods which are exempt from the right to cancel.&nbsp;<br />\r\n<strong>You do not have the right to cancel items which have been modified from standard at your request. This includes but is not limited to hinge holes and custom sizes.</strong></p>\r\n\r\n<p><strong>Any items which have been custom made, such as doors made from our Made to Order ranges, colours/styles outside of the options listed on our website.&nbsp;</strong><br />\r\n&nbsp;</p>\r\n\r\n<p>You can cancel your contract at any time up to 14 days after the day of delivery. To do this, please e-mail, or write to us. We are unable to accept cancellations by phone.</p>\r\n\r\n<p>You do not have to give any reason for cancellation. However, a brief explanation will help us to improve the service we offer to customers in the future.&nbsp;If you cancel, you must return the goods within 14 days of cancellation, complete with the original packaging to us and/or our supplier (or any other UK address specified by us), at your own expense. You must ensure that the goods are packaged adequately to protect against damage.</p>\r\n\r\n<p>You may properly examine the goods for 14 days, however you may not return any goods that have been installed unless they are faulty.</p>\r\n\r\n<p>If you fail to return the goods, we will collect them, and we will charge you the direct cost of collection. If you fail to take reasonable care of the goods before they are returned to us, and this results in damage or deterioration, we will charge you for the reduction in value.</p>\r\n\r\n<p>We will refund all monies paid to us by you including any postage / carriage within 30 days, less any costs due under this contract. Please see point 5.1 for exemptions.</p>\r\n\r\n<p>We reserve the right not to replace any item that has been fitted, as we will deem this acceptance of the goods.</p>\r\n\r\n<p>We will not be held liable for fitter&rsquo;s fees or any other professional trades person&rsquo;s fees due to late, damaged or lost deliveries.</p>\r\n\r\n<p>We are not liable for any loss earnings due to late, incorrect or lost deliveries.</p>\r\n\r\n<p>We reserve the right to refuse replacements on any damaged items reported to us outside of two working days.<br />\r\n<br />\r\nThis cancellation policy does not affect your legal rights - for example, if goods are faulty or Misdescribed.</p>','2018-09-03 07:07:47','2018-09-19 15:03:16',NULL),(4,'Delivery','<p><strong>About these terms</strong><br />\r\nIf you have any further questions please visit our&nbsp;Delivery&nbsp;pages for more information.</p>\r\n\r\n<p><strong>Home</strong>&nbsp;<strong>Deliveries</strong></p>\r\n\r\n<p>We can deliver direct to your home.</p>\r\n\r\n<p>We will deliver the goods to the premises you specify on your order between 7:30am and 6:00pm Monday-Friday.</p>\r\n\r\n<p><strong>You are responsible for ensuring that you are available to accept delivery. If you are not, there must be an adult available who is capable of receiving delivery on your behalf, and you agree that we can rely on their instructions as if they were your own.</strong></p>\r\n\r\n<p><strong>Please ensure that the goods are signed for accordingly.</strong></p>\r\n\r\n<p>If there is no one to accept the order on the scheduled delivery date the goods may be returned to the factory and we reserve the right to charge you an additional re-delivery charge.<br />\r\nWe will not accept responsibility for loss or damage if the delivery company is instructed to leave the goods unattended.</p>\r\n\r\n<p>&nbsp;<strong>Delivery charges, delivery areas</strong></p>\r\n\r\n<p>Free delivery is available on orders where the goods cost more than &pound;300.00.&nbsp;<br />\r\nAdditional charges may apply if you mix doors from a number of different ranges as these may have to be treated as individual orders.</p>\r\n\r\n<p>We can deliver our products anywhere in mainland Great Britain and Republic of Ireland only, excluding any islands or the Highlands/Islands of Scotland.</p>\r\n\r\n<p>&nbsp;<strong>What information do we require from you?</strong></p>\r\n\r\n<p>When you arrange your delivery, we will ask you to provide certain information. This information will be recorded on the delivery document and the delivery will take place at the delivery address you specify. If you provide us with incomplete, incorrect or inaccurate information or instructions, we may cancel the delivery by giving you written notice</p>\r\n\r\n<p>&nbsp;<strong>Online delivery dates</strong></p>\r\n\r\n<p>You will automatically be allocated the earliest delivery date possible during the checkout stage. Proposed delivery lead times are given only for guidance and they can change without notice</p>\r\n\r\n<p>We aim to deliver your online order within 14 days of purchase, depending on stock availability and the delivery address. We will deliver your order within 2-3 working days of dispatch, within 30 days of the order date unless otherwise agreed between us. Your order may arrive in more than one delivery.</p>','delivery-information','<p><strong>About these terms</strong><br />\r\nIf you have any further questions please visit our&nbsp;Delivery&nbsp;pages for more information.</p>\r\n\r\n<p><strong>Home</strong>&nbsp;<strong>Deliveries</strong></p>\r\n\r\n<p>We can deliver direct to your home.</p>\r\n\r\n<p>We will deliver the goods to the premises you specify on your order between 7:30am and 6:00pm Monday-Friday.</p>\r\n\r\n<p><strong>You are responsible for ensuring that you are available to accept delivery. If you are not, there must be an adult available who is capable of receiving delivery on your behalf, and you agree that we can rely on their instructions as if they were your own.</strong></p>\r\n\r\n<p><strong>Please ensure that the goods are signed for accordingly.</strong></p>\r\n\r\n<p>If there is no one to accept the order on the scheduled delivery date the goods may be returned to the factory and we reserve the right to charge you an additional re-delivery charge.<br />\r\nWe will not accept responsibility for loss or damage if the delivery company is instructed to leave the goods unattended.</p>\r\n\r\n<p>&nbsp;<strong>Delivery charges, delivery areas</strong></p>\r\n\r\n<p>Free delivery is available on orders where the goods cost more than &pound;300.00.&nbsp;<br />\r\nAdditional charges may apply if you mix doors from a number of different ranges as these may have to be treated as individual orders.</p>\r\n\r\n<p>We can deliver our products anywhere in mainland Great Britain and Republic of Ireland only, excluding any islands or the Highlands/Islands of Scotland.</p>\r\n\r\n<p>&nbsp;<strong>What information do we require from you?</strong></p>\r\n\r\n<p>When you arrange your delivery, we will ask you to provide certain information. This information will be recorded on the delivery document and the delivery will take place at the delivery address you specify. If you provide us with incomplete, incorrect or inaccurate information or instructions, we may cancel the delivery by giving you written notice</p>\r\n\r\n<p>&nbsp;<strong>Online delivery dates</strong></p>\r\n\r\n<p>You will automatically be allocated the earliest delivery date possible during the checkout stage. Proposed delivery lead times are given only for guidance and they can change without notice</p>\r\n\r\n<p>We aim to deliver your online order within 14 days of purchase, depending on stock availability and the delivery address. We will deliver your order within 2-3 working days of dispatch, within 30 days of the order date unless otherwise agreed between us. Your order may arrive in more than one delivery.</p>','2018-09-03 07:10:22','2018-09-19 15:03:32',NULL),(5,'Contact us','<div class=\"row\">\r\n<div class=\"col-sm-4\">\r\n<h2>Call us</h2>\r\n<p>\r\n<a href=\"tel:01708403806\">01708403806</a><br />\r\n(Lines open Monday - Friday 9am - 5.30pm)\r\n</p>\r\n</div>\r\n\r\n<div class=\"col-sm-4\">\r\n<h2>Email us</h2>\r\n<p><a href=\"mailto:info@kitchenin.co.uk\">info@kitchenin.co.uk</a></p>\r\n</div>\r\n\r\n<div class=\"col-sm-4\">\r\n<h2>Write to us</h2>\r\n<address>Customer Service&nbsp;<br />\r\nKitchenin<br />\r\n103 Corran Way&nbsp;<br />\r\nSouth Ockendon<br />\r\nEssex<br />\r\nRM15 6AP</address>\r\n</div>\r\n</div>','contact-us','<div class=\"row\">\r\n<div class=\"col-sm-4\">\r\n<h2>Call us</h2>\r\n<p>\r\n<a href=\"tel:01708403806\">01708403806</a><br />\r\n(Lines open Monday - Friday 9am - 5.30pm)\r\n</p>\r\n</div>\r\n\r\n<div class=\"col-sm-4\">\r\n<h2>Email us</h2>\r\n<p><a href=\"mailto:info@kitchenin.co.uk\">info@kitchenin.co.uk</a></p>\r\n</div>\r\n\r\n<div class=\"col-sm-4\">\r\n<h2>Write to us</h2>\r\n<address>Customer Service&nbsp;<br />\r\nKitchenin<br />\r\n103 Corran Way&nbsp;<br />\r\nSouth Ockendon<br />\r\nEssex<br />\r\nRM15 6AP</address>\r\n</div>\r\n</div>','2018-09-03 07:12:32','2018-09-19 15:11:33',NULL),(6,'Privacy policy','<p><strong>Purpose of collecting and using data</strong></p>','privacy-policy','<p><strong>Purpose of collecting and using data</strong></p>\r\n\r\n<p>Collecting your data serves to provide you with user-friendly, efficient and secure internet services. We (<strong>RBS Interiors (UK) Ltd &ndash; T/A Kitchenin, 103 Corran Way, South Ockendon, Essex, RM15 6AP</strong>) collect personal data whenever you visit the online shop <strong>kitchenin.co.uk</strong>.</p>\r\n\r\n<p>We comply with the General Data Protection Regulation (GDPR), and we do not sell or pass your details on to anyone else for marketing purposes.</p>\r\n\r\n<p>We process the data with the goal of improving our service and ensuring its security.<br />\r\nFurthermore, whenever you complete transactions in the online shop, using Stripe Payments or PayPal account, or purchasing a Telephone Quote using Debit card, Credit card or Bank transfer, further data processing operations may take place for providing to you the services you have requested and fulfilling our contractual obligations with you.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Contract</strong></p>\r\n\r\n<p>We will use personal data you provided to us for concluding and carrying out contractual agreements with you.</p>\r\n\r\n<p>We will use your name, telephone number, Home address and/or e-mail address for creating Invoice and Payment receipt.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Payments</strong></p>\r\n\r\n<p><strong>Checkout payments</strong> are processed by our merchant service providers Stripe Payments or PayPal.</p>\r\n\r\n<p>Your credit or debit card numbers will be encrypted when your order is placed using SSL encryption software.</p>\r\n\r\n<p>Our merchant providers then process, the transaction on our behalf. We do not store your credit details on our site.</p>\r\n\r\n<p><strong>Telephone Order payments </strong>are processed with using Customer&rsquo;s credit or debit card details. Once used for the purpose of payment, all Customer&rsquo;s financial details are destroyed.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Passing on data to third parties</strong> <strong>- The only third parties who receive your contact information are our suppliers and their couriers, for the sole purpose of fulfilling your order.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Legal ways to disclose Personal Data to third parties</strong></p>\r\n\r\n<p>If and to the extent necessary for the performance of the contracts we have with you or in order to enforce any claims we are entitled to.</p>\r\n\r\n<p>If you have given your consent to such disclosure.</p>\r\n\r\n<p>If we are required by, law or ordered by a court to disclose such information.</p>\r\n\r\n<p>If such information is requested by government agencies, including, without limitation, law enforcement and supervisory authorities, if and to the extent is necessary to remove a risk to public safety and order and to prosecute criminal offences.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Disclosure, rectification and deletion</strong></p>\r\n\r\n<p>You have the right to obtain confirmation and disclosure of personal data we hold about you at any time.</p>\r\n\r\n<p>Requests may be made by email to our customer service at <strong>customerservice@kitchenin.co.uk</strong> or in writing to <strong>RBS Interiors (UK) Ltd &ndash; T/A Kitchenin, 103 Corran Way, South Ockendon, Essex, RM15 6AP</strong></p>\r\n\r\n<p>Moreover, you have the right to have your personal data corrected, blocked or deleted.</p>\r\n\r\n<p>If we have stored any incorrect information about you, please let us know and we will correct it without undue delay. For corrections, please contact us at the postal or email address indicated above.<br />\r\nPersonal data will be deleted if their collection or processing was unlawful from the outset, if their processing or use turns out to be unlawful due to circumstances that arise subsequently or if we no longer need to know such data to fulfil the purpose of their processing or use. Only data we need to complete any tasks that remain outstanding or to enforce our rights and claims, and data we are required to retain by law will be excluded from deletion. However, such data will be blocked.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong id=\"cookies\">Cookies</strong></p>\r\n\r\n<p>We use cookies or other instruments to analyse the usage of our website. Cookies are small files which are saved on your hard drive and which provide us with specific information. This information above all includes the IP address, your browser type, the URL click stream (the chronological order of our internet sites you visited), the date and the time of your visit on our website as well as the cookie number.</p>\r\n\r\n<p>Using cookies and similar instruments makes it possible to recognize you whenever you as a user access our internet sites again after the expiration of a session. Cookies also allow us to ideally adapt our products and services to your individual needs. Lastly, we use cookies to statistically record how often our internet site is viewed as well as the general navigation in order to create encoded usage profiles (see above) with the tools enumerated beneath.</p>\r\n\r\n<p>If you want to disable the use of cookies, you can set your browser to reject and block any new cookies. Details about how this can be done in your browser can be found, for instance, in your browser&rsquo;s help section. However, please note that, if you set your browser to automatically reject cookies, you might no longer be able to use certain features of the website.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Google Analytics</strong></p>\r\n\r\n<p>This website uses Google Analytics, a web analytics service provided by Google, Inc. (&ldquo;Google&rdquo;). Google Analytics uses &ldquo;cookies&rdquo;, which are text files placed on your computer, to help the website analyse how users use the site. The information generated by the cookie about your use of the website (including your IP address) will be transmitted to and stored by Google on servers in the United States. The IP address will be truncated before transmission. On our behalf, Google will use this information for the purpose of evaluating your use of the website, compiling reports on website activity and providing other services relating to website activity and internet activity in connection with the use of the website.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Google Analytics Cookies</strong></p>\r\n\r\n<p><strong>__utma</strong></p>\r\n\r\n<p>This is the main way Google Analytics tracks unique visitors. Stored in this cookie is a unique visitor ID, the date and time of their first visit, the time their current visit started and the total number of visits they have made.</p>\r\n\r\n<p>The __utma cookie is a persistent cookie that expires in two years. With each new visit, the expiration date is refreshed.</p>\r\n\r\n<p><strong>__utmb</strong></p>\r\n\r\n<p>This is how Google Analytics decides whether a visit has timed out and how deep a visit has gotten. It stores the number of page views in the current visit and the start time of the visitor&#39;s current visit.</p>\r\n\r\n<p>The __utmb cookie is a persistent cookie that expires in 30 minutes. Each page view refreshes it.</p>\r\n\r\n<p><strong>__utmc</strong></p>\r\n\r\n<p>The __utmc cookie is the only session cookie used by Google Analytics. Its only purpose is to register that the visit ended if the browser is closed.</p>\r\n\r\n<p><strong>__utmz</strong></p>\r\n\r\n<p>This is the traffic source cookie. It contains all of the <a href=\"http://www.analyticsmarket.com/blog/using-campaign-variables-and-the-url-builder\">traffic source information</a> for the current visit, if it was different from the previous visit. If no traffic source information can be found for the current visit, the cookie is not changed. This is the way that Google Analytics attributes visit information, including conversions and transactions to a traffic source. It does not contain historical information for previous sources.</p>\r\n\r\n<p>This is a persistent cookie with a catch: it expires in six months and is only refreshed when the traffic source changes. Every other cookie is refreshed with each page view. The impact of this is that a banner ad that brings a visitor to your site will get the credit for all future direct visits for up to six months. After six months, if there have not been visits from any other source, the cookie will expire and start to attribute information to direct visits.</p>\r\n\r\n<p><strong>__utmv</strong></p>\r\n\r\n<p>This is the user-defined variable cookie. This new variable gets stored in a persistent cookie, which expires in two years.</p>\r\n\r\n<p><strong>Sending it to Google Analytics</strong></p>\r\n\r\n<p>Finally, all of this cookie information is sent to Google Analytics via the <a href=\"http://www.analyticsmarket.com/blog/__utmgif-data\">__utm.gif request</a> that it makes with each page view. When Google Analytics processes data, it relies on this cookie information (among other pieces of data in the query string) to populate your reports</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Google will not associate your IP address with any other data held by Google. You may refuse the use of cookies by selecting the appropriate settings on your browser; however please note that if you do this you may not be able to use the full functionality of this website. In addition to that you may prevent the collection of the information generated by the cookie about your use of the website (including you IP address) and the processing of this data by Google if you download and install the browser plug-in available at the following link: <strong>https://tools.google.com/dlpage/gaoptout?hl=en</strong></p>\r\n\r\n<p><strong>Security</strong></p>\r\n\r\n<p>We employ technical and organizational security measures to guarantee that your data is protected from loss, incorrect modifications and unauthorized third-party access. To the greatest extent possible, we ensure that only authorized persons have access to your personal data and only insofar as it is necessary in the scope of the above-mentioned purposes.</p>\r\n\r\n<p>Should you have any questions regarding our privacy policy, please contact us via the e-mail address:<strong> customerservice@kitchenin.co.uk</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>','2018-11-22 09:13:26','2018-11-23 02:19:01',NULL);
