INSERT INTO `products` VALUES (26,7,NULL,'Zurfiz Ultragloss  Metallic Blue Kitchen Door','zurfiz-ultragloss-metallic-blue-kitchen-door','<p><strong>Ultragloss Metallic Blue Style&nbsp;in Zurfiz Collection</strong></p>\r\n\r\n<p><strong>Range Description</strong></p>\r\n\r\n<p>This stunning made to measure collection of ultramodern slab doors are available in 12 colour options. The doors are manufactured from 18mm MDF core&nbsp;covered in Senoplast Acrylic, Synchronised Melamine with stunning gloss levels.</p>\r\n\r\n<p>The doors are also offered with 3 edge options, matching edge, brushed steel effect and a stunning glass effect 3D edge producing a deceptively real glazed appearance.</p>\r\n\r\n<p>Made&nbsp;in UK. Dispatch within 7 days.</p>\r\n\r\n<p><strong>Zurfiz Ultragloss &nbsp;Metallic Blue Kitchen Door</strong></p>\r\n\r\n<p>This kitchen door is perfect for anyone looking for the colour of light and breezy weather. With combination with a white kitchen door it will create a great contrast that will add texture and look great. The intricate design with two colours will create a jaw dropping kitchen.</p>',0,1,'2018-05-30 07:53:12','2019-03-12 11:27:33',2,NULL,1,17.99,NULL,18),(27,7,NULL,'Zurfiz Ultragloss Metallic Anthracite Kitchen Door','zurfiz-ultragloss-metallic-anthracite-kitchen-door','<p><strong>Ultragloss Metallic Anthracite Style&nbsp;in Zurfiz Collection</strong></p>\r\n\r\n<p><strong>Range Description</strong></p>\r\n\r\n<p>This stunning made to measure collection of ultramodern slab doors are available in 12 colour options. The doors are manufactured from 18mm MDF core&nbsp;covered in Senoplast Acrylic, Synchronised Melamine with stunning gloss levels.</p>\r\n\r\n<p>The doors are also offered with 3 edge options, matching edge, brushed steel effect and a stunning glass effect 3D edge producing a deceptively real glazed appearance.</p>\r\n\r\n<p>Made&nbsp;in UK. Dispatch&nbsp;within 7 days.</p>\r\n\r\n<p><strong>Zurfiz Ultragloss Metallic Anthracite Kitchen Door</strong></p>\r\n\r\n<p>The metallic anthracite colour slab door when combined with an edging of your choice will look luxurious no matter what ; when combined with a glass effect it will look ultra modern and stylish. Perfect for anyone chasing that luxurious and modern effect to bring to their kitchen</p>',0,1,'2018-05-30 07:53:13','2019-03-12 11:27:33',2,NULL,1,17.99,NULL,21),(28,7,NULL,'Zurfiz Ultragloss  Black Kitchen Door','zurfiz-ultragloss-black-kitchen-door','<p><strong>Ultragloss&nbsp;Black Style&nbsp;in Zurfiz Collection</strong></p>\r\n\r\n<p><strong>Range Description</strong></p>\r\n\r\n<p>This stunning made to measure collection of ultramodern slab doors are available in 12 colour options. The doors are manufactured from 18mm MDF core&nbsp;covered in Senoplast Acrylic, Synchronised Melamine with stunning gloss levels.</p>\r\n\r\n<p>The doors are also offered with 3 edge options, matching edge, brushed steel effect and a stunning glass effect 3D edge producing a deceptively real glazed appearance.</p>\r\n\r\n<p>Made&nbsp;in UK. Dispatch&nbsp;within 7 days.</p>\r\n\r\n<p><strong>Zurfiz Ultragloss &nbsp;Black Kitchen Door</strong></p>\r\n\r\n<p>The dark tones of this glamorous,black slab door are a perfect option for anyone wanting to make their kitchen look Hollywood style but still warm and inviting . By combining it with a wooden worktop you will create a cosy effect given off by the wood ; or just with a plain worktop it will still look absolutely jaw dropping and beautiful</p>',0,1,'2018-05-30 07:53:14','2019-03-12 11:27:33',2,NULL,1,17.99,NULL,22),(29,7,NULL,'Zurfiz Ultragloss Limetsone  Kitchen Door','zurfiz-ultragloss-limetsone-kitchen-door','<p><strong>Ultragloss&nbsp;Limetsone Style&nbsp;in Zurfiz Collection</strong></p>\r\n\r\n<p><strong>Range Description</strong></p>\r\n\r\n<p>This stunning made to measure collection of ultramodern slab doors are available in 12 colour options. The doors are manufactured from 18mm MDF core&nbsp;cov